import React, { Component } from "react";
import "./modal.css";
class Modal extends Component {
  state = {};
  render() {
    return (
      //   <div className="modal">
      <div className="modal-container">
        <div className="modal-content">{this.props.children}</div>
      </div>
      //   </div>
    );
  }
}

export default Modal;
